	(5, 19, NULL, 'Fuga aliquid provident ex quod nesciunt hic atque aliquid.', 'Ipsam asperiores consequatur est laudantium quidem molestias. Dolorum sunt ipsum et saepe earum delectus et qui. Iusto blanditiis impedit nam inventore fuga voluptatem et.', 4, 2, 19, '2025-05-12 23:24:56', '2025-05-12 23:24:56', '2025-04-15 20:45:34'),
